import React from 'react';
import {
  BrowserRouter as Router,
  Routes,
  Route,
  useParams,
} from 'react-router-dom';
import Header from './components/Header';
import Footer from './components/Footer';
import SubHeader from './components/SubHeader';
import FeaturedPage from './pages/FeaturedPage';
import ScoresPage from './pages/ScoresPage';
import SocialPage from './pages/SocialPage';
import PollsPage from './pages/PollsPage';
import HomePage from './pages/HomePage';
import SportPageTemplate from './pages/SportPageTemplate';
import './App.css'; // Empty file, use index.css

function App() {
  return (
    <Router>
      <Header />
      <Routes>
        <Route path="/" element={<HomePage />} />
        <Route path="/:sport" element={<SportPageTemplate />} />
        <Route path="/:sport/featured" element={<FeaturedPage />} />
        <Route path="/:sport/scores" element={<ScoresPage />} />
        <Route path="/:sport/social" element={<SocialPage />} />
        <Route path="/:sport/polls" element={<PollsPage />} />
      </Routes>
      <Footer />
    </Router>
  );
}

export default App;
